import React, {useState, useRef} from 'react';
import './App.css';
import { FiMenu, FiXCircle } from 'react-icons/fi'
import Home from './components/Home';
import Programming from './components/Programming';
import Certificates from './components/Certificates';
import Languages from './components/Languages';
import Experience from './components/Experience';
import Contact from './components/Contact';
import {BrowserRouter} from 'react-router-dom'
// import Navbar from './components/Navbar.js'

function App() {
    const homeRef = useRef(null);
    const programmingRef = useRef(null);
    const certificatesRef = useRef(null);
    const languagesRef = useRef(null);
    const experienceRef = useRef(null);
    const contactMeRef = useRef(null);


    const getHome = () => {
      window.scrollTo({
        top: homeRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const getProgramming = () => {
      window.scrollTo({
        top: programmingRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const getCertificates = () => {
      window.scrollTo({
        top: certificatesRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const getLanguages = () => {
      window.scrollTo({
        top: languagesRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const getExperience = () => {
      window.scrollTo({
        top: experienceRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const getContactMe = () => {
      window.scrollTo({
        top: contactMeRef.current.offsetTop,
        behavior: "smooth"
      })
    }

    const [menuClicked, setmenuClicked] = useState(false);
    const toggleMenuClicked = () => {
        setmenuClicked(!menuClicked);
    }


  return (
    <div>

           <nav className = 'navbar'>
             <span className = "navbar_logo"> A. S.</span>

            { menuClicked ? (
                <FiXCircle size={25} className="navbar_menu" onClick={toggleMenuClicked}/>
                ) : (
                <FiMenu size={25} className="navbar_menu" onClick={toggleMenuClicked}/>
                )
            } 

            <ul
                className = {
                menuClicked ? "navbar_list navbar_list--active" : "navbar_list" }
            >
                <li className = 'navbar_item' onClick={getHome}>
                    <p  className = 'navbar_link'>Home</p>
                </li>
                <li className = 'navbar_item' onClick={getProgramming}>
                    <p  className = 'navbar_link'>Programming</p>
                </li>
                <li className = 'navbar_item' onClick = {getCertificates}>
                    <p  className = 'navbar_link' > Certificates</p>
                </li>
                <li className = 'navbar_item' onClick = {getLanguages}>
                    <p className = 'navbar_link' >Languages</p>
                </li>
                <li className = 'navbar_item' onClick = {getExperience}>
                    <p className = 'navbar_link'>Experience</p>
                </li>
                <li   className = 'navbar_item' onClick = {getContactMe}>
                    <p  className = 'navbar_link'> Contact </p>
                </li>
            </ul>

        </nav>   


        <>

            <div ref={homeRef}>
              <Home/>
            </div>

            <div ref={programmingRef}>
              <Programming/>
            </div>

            <div ref={certificatesRef}>
              <Certificates/>
            </div>

            <div className = "langExpContainer">
              <div ref={languagesRef} className="languagesGlobalContainer">
                <Languages/>
              </div>
              <div ref={experienceRef} className="experienceGlobalContainer">
                <Experience/>
              </div>
            </div>

            <div ref={contactMeRef}>
              <Contact/>
            </div>

        </>    
    </div>
  )
}

export default App;
